    return (
      <div>
        <img className="profile_image split left" src="src\images\MichaelCoca.jpg" alt="Michael" />
        <p className="split right">Lorem ipsum dolor sit amet consectetur, adipisicing elit. Inventore deserunt deleniti tenetur asperiores a corrupti, architecto aspernatur doloribus praesentium quos porro rerum consequuntur est voluptatibus obcaecati repudiandae error dicta sed!</p>
      </div>
    )
  }
}
